    draw(cameraX, cameraY, color = "#0f0f0f") {
        
        for (let i = 0; i < this.hitboxes.length; i++) {
            this.hitboxes[i].draw(cameraX, cameraY, color);
        }

    }
    nDraw(player, camera, color = "#0f0f0f") {
        // this.game.debug.add("50")
        for (let x = Math.max(Math.round(player.x/50)-10,0); x < Math.min(Math.round(player.x/50)+61,this.mapBuffer.length); x++) {
        
            for (let y = Math.max(Math.round(player.y/50)-10,0); y < Math.min(Math.round(player.y/50)+38,this.mapBuffer[x].length); y++) {
                if(this.mapBuffer[x][y] == 1){

                    this.drawU.Rect((x*50)-2,(y*50)-2,54,54,"#0f0f0f")
                }
                if(this.mapBuffer[x][y] == 2){

                    this.drawU.Rect((x*50)-2,(y*50)-2,54,54,"#700000")
                }
                if(this.mapBuffer[x][y] == 3){

                    this.drawU.Rect((x*50),(y*50),50,50,"rgba(0, 255, 50, .3)")
                }
                if(this.mapBuffer[x][y] == 4){

                    this.drawU.Rect((x*50)-2,(y*50)-2,54,54,"rgb(55, 25, 0)")
                }
                if(this.mapBuffer[x][y] >= 5 && this.mapBuffer[x][y]<6){

                    this.drawU.Rect((x*50),(y*50),50,50,"rgba(0, 0, 255,.3)")
                }
                if(this.game.debug.edit || this.game.debug.triggers){
                    if(this.mapBuffer[x][y] >= 6 && this.mapBuffer[x][y]<7){

                        this.drawU.Rect((x*50),(y*50),50,50,"rgba(0, 255, 255,.3)")
                    }
                    if(this.mapBuffer[x][y] >= 100 && this.mapBuffer[x][y]<101){

                        this.drawU.Rect((x*50),(y*50),50,50,"rgba(255, 100, 100,.3)")
                    }
                }
                if(this.mapBuffer[x][y] == 9){

                    this.drawU.Rect((x*50),(y*50),50,50,"rgba(255, 255, 255, .3)")
                }
                // this.hitboxes[i].nDraw(camera, color);
         
            }
        }
    }
    miniDraw(size, speed) {
        if(kd.RIGHT.isDown()){
            this.minimapPos.x += speed
        }
        if(kd.LEFT.isDown()){
            this.minimapPos.x-= speed
        }
        if(kd.UP.isDown()){
            this.minimapPos.y-= speed
        }
        if(kd.DOWN.isDown()){
            this.minimapPos.y += speed
        }
        this.game.draw.Rect(0,0,10000,10000,"rgb(199,199,199)")
        if(!this.minimapDrawn){

            this.makeMiniMap(size)
            this.minimapDrawn=true
        }
        ctx.drawImage(mapCanvas,-this.minimapPos.x*size,-this.minimapPos.y*size)
    }

    makeMiniMap(size){

        mapCanvas.width = this.mapBuffer.length*size;
        
        for (let x = 0; x < this.mapBuffer.length; x++) {
        
            for (let y =0; y < this.mapBuffer[x].length; y++) {
                if(y*size>mapCanvas.height){
                    mapCanvas.height = y*size;
                }
                if(this.mapBuffer[x][y] == 1){

                    this.drawU.Rect(((x-this.minimapPos.x)*size)-2,((y-this.minimapPos.y)*size)-2,size+4,size+4,"#3f3f3f",mctx)
                }
                if(this.mapBuffer[x][y] == 2){

                    this.drawU.Rect(((x-this.minimapPos.x)*size)-2,((y-this.minimapPos.y)*size)-2,size+4,size+4,"#705050",mctx)
                }
                if(this.mapBuffer[x][y] == 3){

                    this.drawU.Rect(((x-this.minimapPos.x)*size),((y-this.minimapPos.y)*size),size,size,"rgba(100, 200, 130, .3)",mctx)
                }
                if(this.mapBuffer[x][y] == 4){

                    this.drawU.Rect(((x-this.minimapPos.x)*size)-2,((y-this.minimapPos.y)*size)-2,size+4,size+4,"rgb(90, 80, 70)",mctx)
                }
                if(this.mapBuffer[x][y] >= 5 && this.mapBuffer[x][y]<6){

                    this.drawU.Rect(((x-this.minimapPos.x)*size),((y-this.minimapPos.y)*size),size,size,"rgba(100, 100, 155,.3)",mctx)
                }
                if(this.mapBuffer[x][y] == 9){

                    this.drawU.Rect(((x-this.minimapPos.x)*size),((y-this.minimapPos.y)*size),size,size,"rgba(255, 255, 255, .3)",mctx)
                }
                // this.hitboxes[i].nDraw(camera, color);
            }
        }
    }
